import React from "react";
import { NavBarItem } from "./NavBarItem";

export const NavBar = (props) => {
    const deleteToken = () => {
        localStorage.removeItem("userToken");
    }

    const pages_list = props.pages.map((item, index) =>{
        return <li key={index}><NavBarItem name={item.name} relativePath={item.relativePath}></NavBarItem></li>
    })

    pages_list.push(<li onClick={deleteToken}><NavBarItem name="Logout" relativePath="/"></NavBarItem></li>)

    return (
        <div id="navbar">
            <ul>
                {pages_list}
            </ul>
        </div>
    )
}
